INSERT INTO `competency` VALUES (1,'search','S001','tipe pencarian',1,NULL,'2019-10-06 17:45:33','2019-10-06 17:45:33','hard_skill',2),(2,'Information seeking','SC003','Hal yang dilakukan Saudara ketika memiliki keinginan untuk mengetahui lebih banyak informasi tentang berbagai hal, orang atau masalah',2,NULL,'2019-11-02 11:43:23','2019-11-02 11:43:23','soft_skill',5),(3,'Generating feedback','SC017','Hal yang Saudara lakukan untuk mendapatkan feedback dari para stakeholder terkait dengan desain atau requirement dari perangkat lunak yang akan dibangun?',2,NULL,'2019-11-02 12:52:39','2019-11-02 12:52:39','soft_skill',5),(4,'Willingness to learn','SC004','Hal yang Saudara lakukan dalam rangka terus belajar dan meningkatkan daya saing?',2,NULL,'2019-11-02 13:02:48','2019-11-02 13:02:48','soft_skill',5),(5,'Trustworthiness / Dependability and reliability','SC005','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait upaya Saudara dalam memenuhi kepercayaan dan harapan orang lain, serta pemenuhan aturan yang berlaku?',2,NULL,'2019-11-02 13:16:24','2019-11-02 13:16:24','soft_skill',5),(6,'Stakeholder Relationship Management','HC018','Bagaimana tindakan Saudara dalam identifikasi, analisis, manajemen dan pemantauan hubungan dengan dan antar pemangku kepentingan ?',4,NULL,'2019-11-02 13:50:57','2019-11-02 13:50:57','hard_skill',5),(7,'Data Analysis','HC010','Bagaimana tindakan Saudara dalam investigasi, evaluasi, interpretasi dan klasifikasi data, untuk menentukan dan mengklarifikasi struktur informasi yang menggambarkan hubungan antara entitas dunia nyata ?',4,NULL,'2019-11-02 13:52:49','2019-11-02 13:52:49','hard_skill',5),(8,'System Testing','HC005','Bagaimana tindakan Saudara dalam perencanaan, desain, manajemen, pelaksanaan dan pelaporan tes perangkat lunak ?',4,NULL,'2019-11-02 13:56:23','2019-11-02 13:56:23','hard_skill',5),(9,'System Design','HC009','Bagaimana tindakan Saudara untuk mngetahui spesifikasi dan desain sistem informasi untuk memenuhi kebutuhan bisnis yang ditetapkan, retensi kompatibilitas dengan arsitektur klien dan solusi, serta kepatuhan terhadap standar dalam batasan biaya, keamanan dan keberlanjutan disisi klien ?',4,NULL,'2019-11-02 14:00:44','2019-11-04 05:57:50','hard_skill',5),(10,'Business Analyst','HC008','Hal yang Saudara lakukan untuk mengetahui spesifikasi dan desain sistem informasi untuk memenuhi kebutuhan bisnis yang ditentukan dalam konteks publik atau pribadi ?',4,NULL,'2019-11-02 14:01:58','2019-11-04 05:56:36','hard_skill',5),(11,'Software Tool Usage','HC003','Bagaimana tindakan Saudara untuk menggunakan berbagai tools perangkat lunak atau membangun tool sendiri untuk produktivitas tugas yang dilakukan dalam rekayasa perangkat lunak ?',4,NULL,'2019-11-02 14:02:47','2019-11-02 14:02:47','hard_skill',5),(12,'Management Proyek','HC001','Bagaimana kontribusi Saudara dalam pengelolaan proyek ?',4,NULL,'2019-11-02 14:03:29','2019-11-04 06:12:22','hard_skill',5),(13,'Pelayanan Pelanggan','SC035','Hal yang umumnya Saudara lakukan untuk memahami kebutuhan, serta melayani untuk memenuhi kebutuhan klien/ rekan tim ?',2,NULL,'2019-11-02 14:04:27','2019-11-02 14:04:27','soft_skill',5),(14,'Pemahaman Tren Teknologi','SC033','Hal yang umumnya Saudara lakukan untuk mengetahui perkembangan teknologi dan kemampuan untuk menggunakan teknologi baru dalam rangka untuk meningkatkan produktivitas dan meminimalkan biaya ?',2,NULL,'2019-11-02 14:05:06','2019-11-02 14:05:06','soft_skill',5),(15,'Pengetahuan Produk','SC030','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara lakukan untuk memiliki pengetahuan tentang bagaimana merancang suatu produk mulai dari komposisi hingga proses pembuatan produk ?',2,NULL,'2019-11-02 14:05:52','2019-11-02 14:25:06','soft_skill',5),(16,'Conflict Management','SC019','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara lakukan dalam menghadapi konflik selama proyek berlangsung?',2,NULL,'2019-11-02 14:06:39','2019-11-02 14:06:39','soft_skill',5),(17,'Integrity','SC016','Hal yang Saudara lakukan untuk berperilaku dengan cara yang jujur, adil, dan etis serta menunjukan konsistensi dalam kata-kata dan tindakan?',2,NULL,'2019-11-02 14:06:50','2019-11-02 14:06:50','soft_skill',5),(18,'Analytical Thinking','SC007','Dari pernyataan berikut manakah yang paling menggambarkan diri Saudara terkait bagaimana cara Saudara dalam mengidentifikasi sumber-sumber masalah, menggunakan pendekatan berpikir yang logis, sistematis dan teratur?',2,NULL,'2019-11-02 14:10:46','2019-11-04 05:02:48','soft_skill',5),(19,'Time Management','SC018','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara lakukan untuk melaksanakan kontrol atas jumlah waktu yang dihabiskan untuk kegiatan tertentu, terutama untuk meningkatkan efisiensi dan produktivitas dalam proyek?',2,NULL,'2019-11-02 14:12:24','2019-11-02 14:12:24','soft_skill',5),(21,'Achievement Orientation (Inovasi) / Creative Thinking','SC014','Bagaimana Saudara dapat mengembangkan wawasan baru ke dalam situasi, mempertanyakan pendekatan konvensional, mendorong ide dan inovasi baru, merancang dan mengimplementasikan program / proses baru atau yang canggih?',2,NULL,'2019-11-02 14:13:17','2019-11-02 14:13:17','soft_skill',5),(22,'Critical Thinking','SC011','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara menentukan tindakan?',2,NULL,'2019-11-02 14:14:00','2019-11-02 14:14:00','soft_skill',5),(23,'Manajemen Perubahan','SC026','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara dalam membangun tim yang kohesif dan memfasilitasi tercapainya tujuan tim?',2,NULL,'2019-11-02 14:14:13','2019-11-02 14:14:13','soft_skill',5),(25,'Leadership','SC012','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara menghubungkan berbagai peran yang terlibat dalam proyek (pengguna, pelaku usaha, maupun profesional teknologi)?',2,NULL,'2019-11-02 14:16:44','2019-11-02 14:16:44','soft_skill',5),(28,'Planning and Control','SC008','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana Saudara mengidentifikasi bagian-bagian pekerjaan yang penting, keterkaitannya, estimasi penyelesaian dan mengendalikan penyelesaian?',2,NULL,'2019-11-02 14:18:12','2019-11-02 14:18:12','soft_skill',5),(29,'Open Communication','SC020','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara melakukan pertukaran informasi dengan stakeholder?',2,NULL,'2019-11-02 14:19:02','2019-11-02 14:25:04','soft_skill',5),(30,'User Requirement','HC019','Bagaimana tindakan Saudara untuk mendefinisikan dan mengelola inisiasi perubahan tujuan bisnis dan ruang lingkup selama requirement ?',4,NULL,'2019-11-02 14:28:18','2019-11-02 14:28:18','hard_skill',5),(31,'Teamwork','SC013','Bagaimana tindakan Saudara untuk bekerja sama secara efektif dengan orang lain, mampu menyesuaikan diri dengan cepat, berkontribusi secara positif dan menjadi bagian dari suatu kelompok dalam melaksanakan suatu tugas dan dalam menghadapi perubahan serta mensosialisasikan dan mengajak orang lain untuk menerima dan mendukung perubahan?',2,NULL,'2019-11-02 14:32:25','2019-11-02 14:32:25','soft_skill',5),(32,'Team Building','SC025','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara dalam membangun tim yang kohesif dan memfasilitasi tercapainya tujuan tim?',2,NULL,'2019-11-02 14:33:20','2019-11-02 15:41:48','soft_skill',5),(33,'Mediator','SC009','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara menghubungkan berbagai peran yang terlibat dalam proyek (pengguna, pelaku usaha, maupun profesional teknologi)?',2,NULL,'2019-11-02 16:05:25','2019-11-02 16:05:25','soft_skill',5),(34,'Java','JAV-1','Bisa pake java?',5,NULL,'2019-12-17 15:57:30','2019-12-17 15:57:30','hard_skill',5),(35,'Standard Programming','HC090','Dari pernyataan berikut, manakah yang paling menggambarkan diri Saudara terkait bagaimana umumnya Saudara dalam membangun sebuah aplikasi??',5,NULL,'2019-12-19 02:27:51','2019-12-19 02:27:51','hard_skill',5);
