lan data yang ditentukan oleh pimpinan',7,NULL,'2019-11-02 14:11:18','2019-11-02 14:11:18'),(17,2,'Memodifikasi atau mempertahankan struktur data dan komponen yang terkait',7,NULL,'2019-11-02 14:11:18','2019-11-02 14:11:18'),(18,3,'Memberikan saran tentang detail struktur data dan komponen terkait',7,NULL,'2019-11-02 14:11:18','2019-11-02 14:11:18'),(19,4,'Memberikan panduan untuk perancang basis data dan lainnya untuk menggunakan struktur data dan komponen terkait',7,NULL,'2019-11-02 14:11:18','2019-11-02 14:11:18'),(20,5,'Mengatur identifikasi kebutuhan data perusahaan, dan mengkoordinasikan penggunaan teknik analisis data dan pemodelan data',7,NULL,'2019-11-02 14:11:18','2019-11-02 14:11:18'),(21,1,'Membentuk komunikasi yang terbuka dan jujur dengan karyawan lain. Fokus terhadap perilaku karyawan lain dalam sikap kepercayaan dan rasa hormat.',18,NULL,'2019-11-02 14:13:12','2019-11-02 14:13:12'),(22,2,'Menyediakan informasi yang akurat tentang visi dan menguraikan perubahan kepada staf/ karyawan lain. Tetap adil dan obyektif ketika menentukan keahlian yang dibutuhkan didalam proyek untuk memilih anggota tim yang efektif.',18,NULL,'2019-11-02 14:13:12','2019-11-02 14:13:12'),(23,3,'Berkomunikasi secara jujur dengan staf mengenai perubahan potensial yang mempengaruhi organisasi untuk memastikan staf diperlakukan dengan adil. Menyelidiki masalah dan mengambil tindakan korektif, sebagaimana mestinya',18,NULL,'2019-11-02 14:13:12','2019-11-02 14:13:12'),(24,4,'Menanamkan iklim kepercayaan dengan mengakui kesalahan sendiri dan mengambil tanggung jawab atas tindakan seseorang. Membahas potensi masalah etika dan kesalahan dengan karyawan serta meresponnya dengan tepat',18,NULL,'2019-11-02 14:13:12','2019-11-02 14:13:12'),(33,1,'Hampir tidak pernah mengungkapkan fakta dan ide dengan jelas. Seringkali memberikan penilaian yang buruk dalam menentukan informasi untuk dibagikan dengan orang lain dan tidak mau mendengarkan orang lain atau memberikan umpan balik/saran',29,NULL,'2019-11-02 14:20:40','2019-11-02 14:20:40'),(34,1,'Tidak pernah berinisiatif untuk menyelesaikan masalah proyek, menunggu masukan atau perintah dari atasan.',28,NULL,'2019-11-02 14:24:15','2019-11-02 14:24:15'),(35,2,'Jarang berinisiatif untuk menyelesaikan masalah. Membutuhkan dorongan dan masukan dari para manajer sebelum mengambil tanggung jawab baru atau mencari solusi untuk masalah. Ragu untuk mengambil tanggung jawab baru atau bertindak berdasarkan peluang',28,NULL,'2019-11-02 14:24:15','2019-11-02 14:24:15'),(36,3,'Seringkali mengambil inisiatif untuk menyelesaikan masalah dengan bantuan minimal dari manajemen. Biasanya bersedia mengambil tanggung jawab baru dan bertindak berdasarkan peluang',28,NULL,'2019-11-02 14:24:15','2019-11-02 14:24:15'),(37,4,'Biasanya mengambil inisiatif untuk menyelesaikan masalah dengan bantuan minimal dari manajemen. Bersedia mengambil tanggung jawab baru dan bertindak berdasarkan peluang.',28,NULL,'2019-11-02 14:24:15','2019-11-02 14:24:15'),(38,5,'Selalu berinisiatif untuk menyelesaikan masalah dengan bantuan minimal dari manajemen. Telah mengambil tanggung jawab baru, dan bertindak atas peluang',28,NULL,'2019-11-02 14:24:15','2019-11-02 14:24:15'),(39,1,'Kemampuan saya umumnya kurang memadai untuk membangun hubungan dan mengembangkan aliansi dengan orang lain.  Saya sulit mengubah gaya komunikasi untuk menangani berbagai jenis orang dan situasi.',25,NULL,'2019-11-02 14:25:47','2019-11-02 14:25:47'),(40,2,'Saya dapat Mengembangkan kemampuan untuk membangun hubungan dan mengembangkan aliansi dengan berbagai orang, meskipun masih memiliki kesulitan untuk memodifikasi gaya komunikasi untuk menghadapi berbagai jenis orang dan situasi',25,NULL,'2019-11-02 14:25:47','2019-11-02 14:25:47'),(41,3,'Saya memiliki kemampuan yang baik untuk membangun hubungan dan mengembangkan aliansi dengan berbagai orang. Terkadang saya memodifikasi gaya komunikasi untuk menangani berbagai jenis orang dengan cara yang tepat.',25,NULL,'2019-11-02 14:25:47','2019-11-02 14:25:47'),(42,4,'Saya memiliki kemampuan yang sangat baik untuk membangun hubungan dan mengembangkan aliansi dengan berbagai orang dan saya terbiasa memodifikasi gaya komunikasi untuk menangani berbagai jenis orang dengan cara yang tepat',25,NULL,'2019-11-02 14:25:47','2019-11-02 14:25:47'),(43,5,'Saya memiliki kemampuan yang sangat baik untuk membangun hubungan dan mengembangkan aliansi dengan berbagai orang. Selalu modifikasi gaya komunikasi untuk menangani berbagai jenis orang dengan cara yang tepat',25,NULL,'2019-11-02 14:25:47','2019-11-02 14:25:47'),(44,1,'Lebih baik dalam melakukan penilaian dan pengambilan keputusan dalam situasi yang terstruktur dengan baik atau rutin. Menimbang keuntungan dan konsekuensi dari opsi alternatif sebelum memutuskan pendekatan yang akan diambil',22,NULL,'2019-11-02 14:27:25','2019-11-02 14:27:25'),(45,2,'Lebih baik dalam melakukan penilaian dan pengambilan keputusan dalam situasi yang cukup kompleks. Mampu membuat keputusan dengan informasi yang tersedia, bahkan jika informasi tersebut tidak sepenuhnya konklusif.',22,NULL,'2019-11-02 14:27:25','2019-11-02 14:27:25'),(46,3,'Selain baik dalam melakukan penilaian dan pengambilan keputusan dalam situasi yang cukup kompleks juga berani membuat keputusan dalam menghadapi risiko atau ketidakpastian.',22,NULL,'2019-11-02 14:27:25','2019-11-02 14:27:25'),(47,1,'Hal yang Saudara lakukan dalam rangka terus belajar dan meningkatkan daya saing? Belajar dari kegagalan, kesalahan atau kejadian negatif',4,NULL,'2019-11-02 14:30:55','2019-11-02 14:30:55'),(48,2,'Terus memperbarui pengetahuan melalui peninjauan materi dan / atau konsultasi dengan ahli internal atau eksternal',4,NULL,'2019-11-02 14:30:55','2019-11-02 14:30:55'),(49,3,'Menunjukkan kelincahan dalam memperoleh pengetahuan, keterampilan, dan kompetensi yang diperlukan berdasarkan pemahaman menyeluruh tentang kekuatan pribadi dan kebutuhan pengembangan',4,NULL,'2019-11-02 14:30:55','2019-11-02 14:30:55'),(50,4,'Melakukaan