ngembangkan reputasi untuk dapat dipercaya. Perlu mengambil langkah untuk berkomunikasi dan memenuhi komitmen, dalam membangun reputasi untuk dapat dipercaya. Harus memprioritaskan komunikasi dengan jujur dan menindaklanjuti komitmen',5,NULL,'2019-11-02 14:32:40','2019-11-02 14:32:40'),(60,3,'Memiliki reputasi yang baik untuk dapat dipercaya. Berusaha untuk berkomunikasi dengan jujur dan menindaklanjuti komitmen',5,NULL,'2019-11-02 14:32:40','2019-11-02 14:32:40'),(61,4,'Memiliki reputasi yang sangat baik untuk dapat dipercaya melalui komunikasi secara jujur dan menindaklanjuti komitmen',5,NULL,'2019-11-02 14:32:40','2019-11-02 14:32:40'),(62,5,'Memiliki reputasi yang unggul, selalu dapat dipercaya melalui komunikasi secara jujur dan menindaklanjuti semua komitmen',5,NULL,'2019-11-02 14:32:40','2019-11-02 14:32:40'),(63,1,'Tidak pernah terbuka terhadap masalah dan konflik di dalam dan luar tim. Lebih menghindari terlibat dalam menyelesaikan konflik dengan anggota lain  atau departemen/ pihak di luar tim.',16,NULL,'2019-11-02 14:34:01','2019-11-02 14:34:01'),(64,2,'Jarang terbuka terhadap masalah dan konflik di dalam dan luar tim. Tidak memiliki pengalaman dalam menyelesaikan konflik dengan anggota lain  atau departemen/ pihak di luar tim.',16,NULL,'2019-11-02 14:34:01','2019-11-02 14:34:01'),(65,3,'Sering terbuka terhadap masalah dan konflik di dalam dan luar tim. Seringkali mendengarkan semua sisi, dan membantu merundingkan solusi terbaik. Ketika ditanya, dapat memebrikan informasi tentang kemajuan dalam negosiasi panjang',16,NULL,'2019-11-02 14:34:01','2019-11-02 14:34:01'),(66,4,'Terbiasa terbuka terhadap masalah dan konflik di dalam dan luar tim. Terbiasa untuk mendengarkan semua pihak, dan membantu merundingkan solusi terbaik. Terbiasa membuat semua pihak mengetahui tentang kemajuan dalam negosiasi panjang',16,NULL,'2019-11-02 14:34:01','2019-11-02 14:34:01'),(67,5,'Selalu terbuka terhadap masalah dan konflik di dalam dan luar tim. Selalu mendengarkan semua pihak, dan membantu merundingkan solusi terbaik. Selalu membuat semua pihak mengetahui tentang kemajuan dalam negosiasi yang panjang',16,NULL,'2019-11-02 14:34:01','2019-11-02 14:34:01'),(68,1,'Menerapkan rencana hubungan/ komunikasi pemangku kepentingan',6,NULL,'2019-11-02 14:34:07','2019-11-02 14:34:07'),(69,2,'Menggunakan saran dari pelanggan dan pemangku kepentingan untuk membantu mengukur efektivitas manajemen pemangku kepentingan',6,NULL,'2019-11-02 14:34:07','2019-11-02 14:34:07'),(70,1,'Mengajukan pertanyaan untuk mengidentifikasi kebutuhan dan harapan dan menanggapi tingkat urgensi yang tepat',13,NULL,'2019-11-02 14:35:53','2019-11-02 14:35:53'),(71,2,'Waspada dan responsif terhadap perubahan harapan dan mencari informasi tentang kebutuhan nyata, di luar yang diekspresikan pada perencanaan',13,NULL,'2019-11-02 14:35:53','2019-11-02 14:35:53'),(72,3,'Secara jelas menyatakan apa yang dapat dan tidak dapat dilakukan untuk memenuhi tujuan dengan penekanan yang kuat pada penerapan kreativitas apa yang dapat dilakukan untuk memenuhi kebutuhan',13,NULL,'2019-11-02 14:35:53','2019-11-02 14:35:53'),(73,4,'Desain solusi untuk mengatasi prioritas utama dan menyesuaikan solusi sesuai kebutuhan untuk mengubah permintaan klien dan pasar',13,NULL,'2019-11-02 14:35:53','2019-11-02 14:35:53'),(74,5,'Mencari tren yang cenderung membentuk keinginan dan kebutuhan di masa depan dan mengembangkan skenario dan strategi yang mengantisipasi kebutuhan masa depan',13,NULL,'2019-11-02 14:35:53','2019-11-02 14:35:53'),(75,1,'Melaksanakan skenario tes yang diberikan di bawah pengawasan',8,NULL,'2019-11-02 14:37:44','2019-11-02 14:37:44'),(76,2,'Meninjau persyaratan dan spesifikasi, dan menentukan kondisi pengujian.',8,NULL,'2019-11-02 14:37:44','2019-11-02 14:37:44'),(77,3,'Menerima tanggung jawab untuk membuat test case dengan menggunakan analisis teknis mendalam dari spesifikasi fungsional dan non-fungsional',8,NULL,'2019-11-02 14:37:44','2019-11-02 14:37:44'),(78,4,'Mengkoordinasikan dan mengatur perencanaan dan semua proses sistem dan / atau acceptance test, Mengemban tanggung jawab untuk integritas pengujian (analis & programer)',8,NULL,'2019-11-02 14:37:44','2019-11-02 14:37:44'),(79,5,'Menentukan kebijakan pengujian, dan memiliki proses pendukung termasuk pengujian keamanan perangkat lunak',8,NULL,'2019-11-02 14:37:44','2019-11-02 14:37:44'),(80,1,'Identifikasi sumber informasi yang relevan (misalnya majalah, konferensi dan acara, buletin, pemimpin opini, forum on-line, dll.). Memantau sumber informasi dan terus mengikuti sumber terpercaya',14,NULL,'2019-11-02 14:38:17','2019-11-02 14:38:17'),(81,2,'Identifikasi vendor dan penyedia solusi yang paling menjanjikan; mengevaluasi, membenarkan dan mengusulkan vendor yang paling tepat. Memetakan teknologi yang muncul dan aplikasi pasar yang relevan',14,NULL,'2019-11-02 14:38:17','2019-11-02 14:38:17'),(82,3,'Menerapkan pendekatan program penelitian. Merancang solusi inovatif untuk integrasi teknologi baru ke dalam produk, aplikasi, atau layanan yang ada atau untuk menciptakan solusi baru',14,NULL,'2019-11-02 14:38:17','2019-11-02 14:38:17'),(83,1,'Melakukan desain lengkap terhadap aplikasi sederhana, menggunakan template dan tool sederhana',9,NULL,'2019-11-02 14:39:56','2019-11-02 14:39:56'),(84,2,'Menghasilkan desain dan dokumen mendetail yang menggunakan standar, metode, dan tools yang diperlukan, termasuk tool prototyping jika diperlukan.',9,NULL,'2019-11-02 14:39:56','2019-11-02 14:39:56'),(85,3,'Merekomendasikan / merancang struktur dan tool untuk sistem yang dapat memenuhi kebutuhan bisnis, menyediakan visualisasi teknis dari aplikasi yang diusulkan, menghasilkan dokumentasi desain terperinci',9,NULL,'2019-11-02 14:39:56','2019-11-02 14:39:56'),(86,4,'Menentukan dan mendesain sistem besar atau kompleks',9,NULL,'2019-11-02 14:39:56','2019-11-02 14:39:56'),(87,5,'Mengontrol praktik rancangan sistem dalam suatu perusahaan atau arsitektur industri.',9,NULL,'2019-11-02 14:39:56','2019-11-02 14:39:5